import React from "react";
const HandleSubmit = () => {

}

const addQues = () => {
    return(
        <>
            <form onSubmit={HandleSubmit}>
                <div class="form-group">
                    <label for="exampleFormControlInput1">Company name</label>
                    <input type="email" class="form-control" id="companyName" placeholder="Rovers Compass"/>
                </div><div class="form-group">
                <label for="exampleFormControlInput1">Questions</label>
                    <input type="email" class="form-control" id="questions" placeholder="Whats your name?"/>
                </div>
                <div class="form-group">
                    <label for="exampleFormControlTextarea1">Answer</label>
                    <textarea class="form-control" id="answer" rows="3"></textarea>
                </div>
                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
        </>
    );
}

export default addQues;
